function infeasible_constraints = check_qp_feasibility_(A, l, u)
% : A, l, u  OSQP  QP  Ax  [l, u]
% : infeasible_constraints -- 

n = size(A,2);   % 
m = size(A,1);   % 

%  l, u 
l = l(:);
u = u(:);

%  s  R^m, 
cvx_begin quiet
variables x(n) s(m)
minimize( sum(s) )
subject to
A*x <= u + s;
A*x >= l - s;
s >= 0;
cvx_end

% 
slack_thresh = 1e-5;
infeasible_constraints = find(s > slack_thresh);

% 
fprintf('[QP Check] Found %d conflicting constraints (s > %.1e)\n', ...
    length(infeasible_constraints), slack_thresh);

if ~isempty(infeasible_constraints)
    fprintf('Conflicting constraints details:\n');
    for idx = infeasible_constraints'
        % 
        Ax_val = A(idx,:)*x;
        slack_val = s(idx);
        fprintf('Constraint #%d: A*x=%.4g, lower=%.4g, upper=%.4g, slack=%.4g\n', ...
            idx, Ax_val, l(idx), u(idx), slack_val);
    end
else
    fprintf('No significant conflicts detected.\n');
end
end

